  \"Bird communities of coniferous forests in the Acadian region: their habitat associations
  and responses to forest management\",\n\t\"tracking_summary\": {\n\t\t\"total\":
  1,\n\t\t\"recent\": 1\n\t},\n\t\"groups\": [],\n\t\"relationships_as_subject\":
  [],\n\t\"revision_timestamp\": \"2016-07-27T23:06:33.651746\",\n\t\"name\": \"bird-communities-of-coniferous-forests-in-the-acadian-region-their-habitat-associations-an\",\n\t\"isopen\":
  false,\n\t\"url\": null,\n\t\"notes\": \"This annual report documents project activities
  for bird communities of coniferous forests in the Acadian Region. The objectives
  of this project are to: (1) quantify the composition and forest associations of
  coniferous bird communities in four silvicultural treatments representing a gradient
  in mature canopy residuals compared to mature softwood reference sites; (2) model
  the influences of silvicultural practices on coniferous forest bird communities;
  (3) use data at both landscape and local scales to determine important habitat and
  beneficial forest management practices; (4) provide accessible and interpretable
  results for forest managers that can be used to manage for avian species of concern
  in managed forest landscapes and stands.\",\n\t\"license_title\": \"License Not
